import React, { Component } from 'react'

export default class Events extends Component {
  render(props) {
    const events=this.props.events;
    const eventItems=events.map(eventItem => <div className="event_div"><p className="event">{eventItem.participant1} &nbsp; <b>vs</b> &nbsp; {eventItem.participant2}</p></div>);
    return (
      <div>
        {eventItems}
      </div>
    )
  }
}
